import Snackbar from '../../components/Snackbar/Snackbar';

import './MainLayout.css';

const MainLayout = (props) => (
    <div>
        <Header />

        <div className="MainLayout">
                    <div class="row">
                <div class="col-md-3">
                <div className="mb-4 ml-2 border">
                    <Link to="/">
                        <i className="fa fa fa-home fa-lg text-black mr-1">
                        </i>
                        <span className="pos-ab-left text-2xl">Trang chá»§</span> 
                    </Link>
                </div>
                </div>
                <div class="col-md-3 ml-auto">.col-md-4 .ml-auto</div>
            </div>
        </div>


        <ModalConductor />
        <Snackbar />
        <Footer />
    </div>
);

export default MainLayout;
